INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "アヤネ", 2, 24, 24001, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, "2020/07/31 12:00:00", 401, 0.0, 102301, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "アヤネ", 2, 24, 24002, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, "2020/07/31 12:00:00", 402, 0.0, 102301, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "アヤネ", 2, 24, 24003, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, "2020/07/31 12:00:00", 403, 0.0, 102301, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "アサヒ", 1, 24, 24004, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, "2020/07/31 12:00:00", 701, 0.0, 192201, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "アサヒ", 2, 24, 24005, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, "2020/07/31 12:00:00", 702, 0.0, 192201, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "アサヒ", 1, 24, 24006, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, "2020/07/31 12:00:00", 703, 0.0, 192201, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "部員３", 2, 24, 24007, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, "2020/07/31 12:00:00", 801, 0.0, 192301, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "部員３", 2, 24, 24008, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, "2020/07/31 12:00:00", 802, 0.0, 192301, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "部員３", 2, 24, 24009, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, "2020/07/31 12:00:00", 803, 0.0, 192301, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "", 1, 24, 24010, "やった！", 0.0, "2020/07/31 12:00:00", 501, 0.0, 192501, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "", 1, 24, 24011, "勝ったよ！", 0.0, "2020/07/31 12:00:00", 502, 0.0, 192501, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "", 1, 24, 24012, "いい調子！", 0.0, "2020/07/31 12:00:00", 503, 0.0, 192501, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ミサト", 2, 24, 24013, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, "2020/07/31 12:00:00", 111, 0.0, 113501, 6);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ミサト", 2, 24, 24014, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, "2020/07/31 12:00:00", 112, 0.0, 113501, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ミサト", 2, 24, 24015, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, "2020/07/31 12:00:00", 113, 0.0, 113501, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ダイチ", 2, 24, 24016, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, "2020/07/31 12:00:00", 611, 0.0, 192401, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ダイチ", 2, 24, 24017, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, "2020/07/31 12:00:00", 612, 0.0, 192401, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ダイチ", 2, 24, 24018, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, "2020/07/31 12:00:00", 613, 0.0, 192401, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ハツネ", 1, 24, 24019, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, "2020/07/31 12:00:00", 211, 0.0, 113401, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ハツネ", 1, 24, 24020, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, "2020/07/31 12:00:00", 212, 0.0, 113401, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ハツネ", 2, 24, 24021, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, "2020/07/31 12:00:00", 213, 0.0, 113401, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "カヤ", 2, 24, 24022, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, "2020/07/31 12:00:00", 311, 0.0, 106501, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "カヤ", 2, 24, 24023, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, "2020/07/31 12:00:00", 312, 0.0, 106501, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "カヤ", 1, 24, 24024, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, "2020/07/31 12:00:00", 313, 0.0, 106501, 6);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "アヤネ", 3, 24, 24025, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, "2020/07/31 12:00:00", 421, 0.0, 102301, 4);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "アサヒ", 1, 24, 24026, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, "2020/07/31 12:00:00", 721, 0.0, 192201, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "部員３", 3, 24, 24027, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, "2020/07/31 12:00:00", 821, 0.0, 192301, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "", 1, 24, 24028, "いい勝負だったよ\nまたやろうね", 0.0, "2020/07/31 12:00:00", 521, 0.0, 192501, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ミサト", 2, 24, 24029, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, "2020/07/31 12:00:00", 101, -360.0, 113501, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ミサト", 2, 24, 24030, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, "2020/07/31 12:00:00", 102, -360.0, 113501, 1);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ミサト", 2, 24, 24031, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, "2020/07/31 12:00:00", 103, -360.0, 113501, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ミサト", 1, 24, 24032, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, "2020/07/31 12:00:00", 104, -360.0, 113501, 2);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES ("2030/12/17 14:59:59", 0.0, 10046, "ミサト", 2, 24, 24033, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, "2020/07/31 12:00:00", 105, -360.0, 113501, 1);
